import contents from './contents.js';


const Cards = () => {
    return (
        <>
        {contents.map((content)=>{
          return <CardFlip 
            type={content.type}
            image={content.image}
            flipped={content.flipped}
            color={props.color}
          /> 
        })}
        </>
    );
}

export default Cards;
